import { useSpring, animated } from "react-spring";
import AccountCard from "../Components/AccountCard";

const FadeIn = ({ ...rest }) => {
  const Spring = useSpring({
    opacity: 1,
    from: { opacity: 0 },
  });
  return (
    <animated.div style={Spring}>
      <AccountCard {...rest} />
    </animated.div>
  );
};

export default FadeIn;
